const App = () => {
  const name =  null;

  return (
    <div className="App">
      <h1>Hello, {2 + 2}!</h1>
      {name ? (
        <>
        <h1>{name}</h1>
        </>
      ): (
        <>
        <h1>test</h1>
        <h2> There is no name.</h2>
        </>
      )}
    </div>
  );
}

export default App;
